import React from "react";
import Menu from "./Menu";
import bg1 from "./group-of-dogs.jpg";


export class Page extends React.Component {
    constructor() {
        super();

        this.state = {
            CurrPage:0
        };
    }
    render() {
        return (
                <div>
                    {bg1}
                <Menu
                        OnChange={(p)=>{
                            // alert(p);
                            this.setState({CurrPage:p});
                        }}
                        CurrPage={this.state.CurrPage}
                >
                </Menu>
                </div>
        );
    }
}
